import React from "react";
import { Field, reduxForm } from "redux-form";

class StreamCreate extends React.Component {
  render() {
    return (
      <form>
        <Field />
      </form>
    );
  }
}

// Hook up reduxForm
// after that we will have a bunch of props to use depending on our needs
export default reduxForm({
  form: "streamCreate",
})(StreamCreate);
